	font-size: 36px;
	font-family: 'FontAwesome';
	color: #FFF;
	z-index: 5;
	outline: none;
	cursor: pointer;
}

.Modern-Slider .NextArrow:before {
	content: '\f105';
}

.Modern-Slider .PrevArrow {
	position: absolute;
	top: 50%;
	left: 30px;
	border: 0 none;
	background-color: transparent;
	text-align: center;
	font-size: 36px;
	font-family: 'FontAwesome';
	color: #FFF;
	z-index: 5;
	outline: none;
	cursor: pointer;
}

.Modern-Slider .PrevArrow:before {
	content: '\f104';
}

